import React from 'react';
import ReactDOM from 'react-dom';
import './List'
import {sum , sub , mult , div} from './List';

ReactDOM.render(<ol>

  <li>sum of two numbers {sum(4,7)}</li>
  <li>sub of two numbers {sub(4,7)}</li>
  <li>mult of two numbers {mult(4,7)}</li>
  <li>div of two numbers {div(4,7)}</li>

      </ol>
, document.getElementById('root')
);
